import React from 'react';

function Home() {
    return(
        <>
            <div>
                {/* Hi! section */}
                <div className="h-screen bg-[#FEF4DE]">
                    <div className="justify-center font-extrabold text-6xl">
                        <p className="text-[#424242]">Hi! I am</p>
                        <p className="text-[#FF3535]">Gui Hendro</p>
                    </div>
                </div>

                {/* About me section */}
                <div className="h-screen bg-[#FFD438]">
                    Hello
                </div>

                {/* Education section */}
                <div className="h-screen bg-[#FEF4DE]">
                    Hello
                </div>

                {/* Projects section */}
                <div className="h-screen bg-[#FFD438]">
                    Hello
                </div>

                {/* Footer */}
                <div className="h-64 bg-[#FEF4DE]">
                    Hello
                </div>
            </div>
        </>
    );
}

export default Home;
